import React from 'react';

function PricingComp(props) {
    return (
        <div className = 'row mx-auto py-3' style = {{ width : "80%" }}>
            <div className = 'card'>
                <h3 className = 'card-title'>{ props.pricingName }</h3>
                <h6 className = "card-subtitle">{ props.pricingExplain }</h6>
            </div>
        </div>
    );
}

export default PricingComp;
